  input: 'TEXT,F3T,,"As per my discussion with the FEC, I am submitting this memo
    text as a final statement for the Termination of this campaign.  First, the campaign
    has NO debt.  Second, the campaign has well less than $1,000 in total remaining
    funds.  The remaining money will be used, as per the FEC regulations, for any
    regular campaign expense as if the campaign were continuing forward.  As suggested
    by the FEC, the following is a list of item that the remaining money will be used
    for:  final phone bills; cancellation fees on the phone or DSL service; campaign
    website maintenance fees; P.O. Box fees; postage for any remaining mailings such
    as thank you letters to the contributors; stationary and office supplies (i.e.,
    computer ink) needed for the winding down of the campaign committee; and corporate
    dissolution fees and/or expenses (the campaign committee was a nonstock, not for
    profit corporation that has to be dissolved)."'
